def round_half(number):
     return round(number * 2) / 2

def dict_lookup(GTIN_dict,quantity_sheet,gtin_output_sheet,just_3_skus):
     #go through every row and check if there is a SKU(cell containing a number) in any of the 3 rows where there are usually sku's output by quickbooks
     for idx,row in just_3_skus.iterrows():
          for cell in row:
               if type(cell) == str:
                    if any(char.isdigit() for char in cell):
                         #if we find a SKU, we need to append a row with GTIN, SKU, and rounded quantity to output sheet
                         for this in infile_GTIN:
                              if this['SKU'] == cell:
                                   row_gtin_sku_qty = pd.DataFrame({'GTIN':[this['GTIN']],'SKU':[this['SKU']],'Quantity':[round_half(quantity_sheet.at[idx,'Qty'])]})
                                   gtin_output_sheet = gtin_output_sheet.append(row_gtin_sku_qty)
     return gtin_output_sheet

